import React, { useEffect, useState } from "react";
import { useLocation } from 'react-router-dom';

function Home() {
    const location = useLocation();
    const [user, setUser] = useState({});
    const [loading, setLoading] = useState(true);

    useEffect(() => {
        setUser(location.state.user);
        fetchData(); // Fetch data from server when component mounts
    }, [location.state.user]);

    const fetchData = async () => {
        try {
            const response = await fetch('http://localhost:8000/', {
                method: 'POST',
                headers: {
                    'Content-Type': 'application/json'
                },
                body: JSON.stringify(location.state.user) // Send user data to server
            });

            const data = await response.json();
            console.log(data); // Log response from server

            setLoading(false); // Update loading state
        } catch (error) {
            console.error('Error:', error);
        }
    };

    if (loading) {
        return <div>Loading...</div>;
    }
    return (
        <div className="container">
            <div className="box">
                <div className="topbar">
                    <div style={{ textAlign: "center" }}>
                        Connected Devices: <br />
                        <span>{user.connectedDevices}</span>
                    </div>
                    <div className="right">
                        Network Device Name: <br />
                        <span>{user.networkDevicesname}</span>
                    </div>
                    <div className="left">
                        <span>{user.name}</span>
                    </div>
                </div>
                <div className="div1">
                    <div>
                        <p>
                            <i className="fa-solid fa-wallet" style={{ color: "orange" }}></i> Curent Balance: <span>{user.currentBalance}</span>
                        </p>
                        <p>
                            <i className="fa-solid fa-coins" style={{ color: "orange" }}></i> Amount Due: Ksh <span>{user.Amount}</span>
                        </p>
                    </div>
                    <div>
                        <p>
                            <i className="fa-solid fa-check fa-lg" style={{ color: "#2fb90c" }}></i> Payment Status: <span>{user.paymentStatus}</span>
                        </p>
                    </div>
                </div>
                <div className="div2">
                    <p>Current Package</p>
                    <div className="net">
                        <div>
                            <p className="span">
                                <span>{user.networkSpeed}</span>
                            </p>
                            <p>Network Speed</p>
                        </div>
                        <div className="line"></div>
                        <div>
                            <p className="span">
                                <span id="remainingDays">{user.RemainingDays}</span> Days
                            </p>
                            <p id="expiryDate">
                                Expires on: <span id="expiryDateValue">{user.subscriptionStartDate}</span>
                            </p>
                        </div>
                    </div>
                </div>
                <div className="div3">
                    <div>
                        <p>
                            <i className="fa-solid fa-signal" style={{ color: "#dcedf9" }}></i> Signal Strength
                        </p>
                        <p className="dbm">{user.signalStrength}</p>
                    </div>
                </div>
                <div className="net">
                    <a href="https://wa.me/+254772809396" target="_blank" rel="noopener noreferrer">Chat with us on WhatsApp</a>
                    <a href="/" className="button">Log out</a>
                </div>
            </div>
        </div>
    );
}

export default Home;
